!function(t,r){t.Errors={phone:"请输入合法的手机号",password:"密码只能为6-32位数字，字母及常用符号组成",realName:"姓名必须是汉字且长度不超过5个",identifyNumber:"身份证号码错误",bankCard:"银行卡号码错误",code:"请输入验证码"},t.validator("notNull",function(t){return!!t}),t.validator("phone",function(t){return/^1\d{10}$/.test(t)}),t.validator("password",function(t){return/^[A-Za-z0-9\^$\.\+\*_@!#%&~=-]{6,32}$/.test(t)}),t.validator("identifyNumber",function(t){return/^\d{18}$|^\d{17}(\d|X|x)$/.test(t)}),t.validator("chineseName",function(t){return/^[\u4e00-\u9fa5]{1,5}$/.test(t)}),t.validator("bankCard",function(t){return t=t.replace(/\s/g,""),/^\d{13,19}$/.test(t)})}(Vue,Zepto);